import React, { Component } from 'react'

const pStyle = {
  textAlign: 'center',
  fontFamily: 'Fantasy',
  fontSize: '45px'
};

const imgStyle = {
  display: 'flex',
  marginLeft: 'auto',
  marginRight: 'auto',
  width: '30%',
  border: '8px solid'
};

const backGround = {
  height: '100%',
  background: 'linear-gradient(90deg, red 50%, white 50%)'
}

export default class Show extends Component {
  render() {
    const {name, img} = this.props.pokemon
    return (
        <div>
          <body style={backGround}>
          <a href={`/pokemon`}> back</a>
          <h1 style={pStyle}>Gotta Catch 'Em All!</h1>
                <div key='{pokemon}'>
                  <h2 style={pStyle}>{name.charAt(0).toUpperCase() + name.slice(1)}</h2> <br></br>
                  <img style={imgStyle} src={img + name +'.jpg'}></img>
                </div>
        </body>
      </div>
    )
  }
}

module.exports = Show;

